import Footer from "../components/Footer";


export default function Plan() {
    return(
        <div className="plan">
        <Header />
        <h2>Hi, plan your trip here.</h2>

        <hr/>

      <Todo />
        <hr/>

        <CurrencyConverter />
        <hr/>

		<h2>Get Country Info..</h2>
        <CouInfoMain />


        <Footer />
        </div>
    );
}
